// src/pages/EditarPet.jsx
import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import api from '../../services/api';

export default function EditarPet() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    especie: '',
    raca: '',
    idade: '',
    peso: '',
    porte: '',
    sexo: '',
    cor: '',
    castrado: false,
    carteiraVacinacao: false,
    tutor: '',
    dono: '',
    admin: '',
    observacoes: ''
  });

  useEffect(() => {
    api.get(`/pets/${id}`)
      .then(response => setForm(response.data))
      .catch(error => console.error('Erro ao carregar pet:', error));
  }, [id]);

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    const val = type === 'checkbox' ? checked : value;
    setForm(prev => ({ ...prev, [name]: val }));
  };

  const handleSubmit = e => {
    e.preventDefault();
    api.put(`/pets/${id}`, form)
      .then(() => navigate(`/pets/${id}`))
      .catch(error => console.error('Erro ao atualizar pet:', error));
  };

  return (
    <div className="container my-5">
      <h2 className="mb-4">Editar Pet</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Nome</label>
          <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
        </div>
        <div className="mb-3">
          <label className="form-label">Espécie</label>
          <input name="especie" className="form-control" value={form.especie} onChange={handleChange} />
        </div>
        <div className="mb-3">
          <label className="form-label">Raça</label>
          <input name="raca" className="form-control" value={form.raca} onChange={handleChange} />
        </div>
        <div className="mb-3">
          <label className="form-label">Idade</label>
          <input name="idade" type="number" className="form-control" value={form.idade} onChange={handleChange} />
        </div>
        <div className="mb-3">
          <label className="form-label">Peso (kg)</label>
          <input name="peso" type="number" className="form-control" value={form.peso} onChange={handleChange} />
        </div>
        <div className="mb-3">
          <label className="form-label">Porte</label>
          <input name="porte" className="form-control" value={form.porte} onChange={handleChange} />
        </div>
        <div className="mb-3">
          <label className="form-label">Sexo</label>
          <select name="sexo" className="form-select" value={form.sexo} onChange={handleChange}>
            <option value="">Selecione</option>
            <option value="Macho">Macho</option>
            <option value="Fêmea">Fêmea</option>
          </select>
        </div>
        <div className="mb-3">
          <label className="form-label">Cor</label>
          <input name="cor" className="form-control" value={form.cor} onChange={handleChange} />
        </div>
        <div className="form-check mb-3">
          <input type="checkbox" name="castrado" className="form-check-input" checked={form.castrado} onChange={handleChange} />
          <label className="form-check-label">Castrado</label>
        </div>
        <div className="form-check mb-3">
          <input type="checkbox" name="carteiraVacinacao" className="form-check-input" checked={form.carteiraVacinacao} onChange={handleChange} />
          <label className="form-check-label">Carteira de Vacinação em Dia</label>
        </div>
        <div className="mb-3">
          <label className="form-label">Observações</label>
          <textarea name="observacoes" className="form-control" rows={3} value={form.observacoes} onChange={handleChange} />
        </div>

        {/* Botões iguais aos do EditarTutor */}
        <div className="d-flex justify-content-center gap-2 mt-3">
          <button type="submit" className="btn btn-primary">Salvar</button>
          <button type="button" className="btn btn-secondary" onClick={() => navigate(`/pets/${id}`)}>Cancelar</button>
        </div>
      </form>
    </div>
  );
}
